import './index.css';

function ToDo_list(){
    return(
        <>
            <div className="main">
                <div className="center">
                    <br/>
                    <h1>ToDo List</h1>
                    <br/>
                    <input type="text" placeholder="Add an Item" />
                    <button>+</button>
                    <ol>
                        <li>Learn React</li>
                    </ol>
                </div>
            </div>
        </>
    );
};

export default ToDo_list;
